	//타임세일 //main
	function initTimeSale() {
		var act = 0;
		var openHourArr = [10, 11, 13, 14];
		var now = new Date();
		//var now = new Date(2017, 9, 25, 10, 59, 55); //xxx

		var tsaleContainerDIV = $('.midCont02 > .swiper-container');
		var tsaleItemContainerDIV = tsaleContainerDIV.find('.swiper-wrapper');
		var tsaleItem =  tsaleContainerDIV.find('.swiper-slide');
		
		//타이머
		var closeCountDown = new CountDown();

		var endDate = new Date(now);
		endDate.setDate(now.getDate() + 1);
        endDate.setHours(0);
        endDate.setMinutes(0);
        endDate.setSeconds(0);

        //초기화
        tsaleItem.addClass('comingSoon');

        closeCountDown.setTime(now, endDate, {
            complete: function () {
                
            },
            callback: function (data) {
                tsaleItem.find('.timeSaleTime > span').html(data.h + '<span>:</span>' + data.m + '<span>:</span>' + data.s);

                tsaleItem.each(function (idx) {
                	drawCanvas($(this), data.date, idx);
                });

                var currentDate = new Date(data.date);
                var ch = currentDate.getHours(); //현재 시간

                openHourArr.forEach(function (openH, index) {
                	var chooseLI = tsaleItem.eq(index);

                	if (openH <= ch) { //오픈 시간 보다 현재 시간이 이후 이면 열기
                		chooseLI.removeClass('comingSoon');
                		act = index;
                	}

            		if (chooseLI.hasClass('soldOut')) { //판매완료면 시간 00:00:00 처리
            			chooseLI.find('.timeSaleTimer > span').html('00<span>:</span>00<span>:</span>00');
            		}
					/*
					if (chooseLI.hasClass('comingSoon')) {
	        			chooseLI.find('.timeSaleTime > span').html('00<span>:</span>00<span>:</span>00');
	        			chooseLI.find('canvas').css('opacity', 0);
        			} else {
        				chooseLI.find('canvas').css('opacity', 1);
        			}
        			*/
                });
            },
            interval: true
        });

        function drawCanvas(target, date, idx) {
        	var canvas = target.get(0).querySelector('canvas');

        	var startMilliSeconds = 1000 * 60 * 60 * (openHourArr[idx]);

    		var endDate = new Date(date);
    		endDate.setDate(date.getDate() + 1);
    		endDate.setHours(0);
    		endDate.setMinutes(0);
    		endDate.setSeconds(0);

			$(canvas).attr({
        		width : $(canvas).width(),
        		height : $(canvas).height()
        	});

        	if (canvas !== undefined) {
				var ctx = canvas.getContext('2d');
				var percent = getLinearFunction(-86400000/* + startMilliSeconds*/, 0, 0, /*2*/1.93, Math.min(0, date.getTime() - endDate.getTime()));
				
				var x = canvas.width * 0.5;
				var y = canvas.height * 0.5;
				var radius = canvas.width * 0.5;
				var startAngle = 0 * Math.PI;
				var endAngle = percent * Math.PI;
				var counterClockwise = false;

				ctx.save();
				ctx.translate(x, y);          //중심점 위치변경
				ctx.rotate((1.5 + 0.035) * Math.PI);       //돌림
				ctx.translate(-x, -y);          //중심점 위치변경

				ctx.strokeStyle = '#d52667';
				ctx.lineWidth = 10 * 2;
				ctx.lineCap = 'round';
				ctx.beginPath(); // 뎁스 올리기
				ctx.arc(x, y, Math.max(0, radius - (ctx.lineWidth * 0.5)), startAngle, endAngle, counterClockwise);
				ctx.stroke();
				ctx.restore();

				if (percent === 0) ctx.clearRect(0 , 0, canvas.width, canvas.height);
        	}
        }
	}

