	//이벤트
	function initEvent() {
		$(window).on('resize.expo', function (e) {
            if (WDDO.browserWidth === $(window).width() && WDDO.browserHeight === $(window).height()) return false;
            WDDO.browserWidth = $(window).width();
            WDDO.browserHeight = $(window).height();

		}).triggerHandler('resize.expo');

		var scrollStatus = new WScrollStatus();
		scrollStatus.init({namespace: 'header', exChange: function (data) {
			//스크롤 내리면 해더 숨김
			if (data.direct === 'down' && $(window).scrollTop() > 54) {
				TweenMax.to(header, 0.2, {transform : 'translateY(-54px)'});
			} else if (data.direct === 'up') {
				TweenMax.to(header, 0.2, {transform : 'translateY('+ 0 +'px)'});
			}

			//전체메뉴 열려 있으면 닫기
			if (allMenuDIV.not(':hidden') && data.distance !== 0) allMenuDIV.hide();
		}});
	}

