    //항공관 //sub_free_air
    function initAir() {
    	if (!wrapDIV.hasClass('freeAirWrap')) return;

    	//비주얼
    	new SwiperTemplate().initFreeSwiper(wrapDIV.find('.swiper-container.freeTopSwiper'), {loop: false, slidesPerView: 1.15, slidesOffsetBefore: 15, slidesOffsetAfter: 15, spaceBetween: 10});

    	//알짜항공
    	new SwiperTemplate().initFreeSwiper(wrapDIV.find('.swiper-container.dateSwiper'), {/*slidesPerView: 5.5*/
    		onInit: function (data) {
    			var todaySaleText = $(data.container).next('.tabCont').find('.airTimeSaleInner > p').text();
    			var regionText = $(data.container).next('.tabCont').find('.airTimeSaleTxtTop > dl > dt').contents().eq(2).text().replace(/\s+|\>/g, '');
				var matchDataArr = todaySaleText.match(/\d+/g);

				if ($.isArray(matchDataArr) && matchDataArr.length > 2)  {
					var today = matchDataArr[1];
					activateTimeSale(today, regionText);
				}
    		}
    	});
    	//리셋방법 EXPO.Swiper.resetSwiper($('.swiper-container.dateSwiper'));

    	//알짜항공 컨테츠를 기반으로 해당일 스와이프 활성화 & 목적지 text 변경
    	function activateTimeSale(today, region) {
    		var act;

    		wrapDIV.find('.swiper-container.dateSwiper .swiper-slide').each(function (idx) {
    			var slide = $(this);

    			if (slide.find('span.dateSwiperDate').text() === today) {
    				slide.addClass('on').siblings().removeClass('on');
    				slide.find('span.dateSwiperPlace').text(region);
    				act = idx;
    				
    				return false;
    			}
    		});
    		
    		var swiper = wrapDIV.find('.swiper-container.dateSwiper')[0].swiper;
    		if (swiper !== undefined) swiper.slideTo(act);
    	}

    	/*
    	wrapDIV.find('.swiper-container.dateSwiper').on('click.expo', '.swiper-slide > a', function (e) {
    		var target = $(e.currentTarget);
    		var li = target.closest('li.swiper-slide');
    		var idx = li.index();

    		li.addClass('on').siblings().removeClass('on');
    		wrapDIV.find('.swiper-container.dateSwiper').nextAll('.tabCont').hide().eq(idx).show();
    	});
    	*/
    	wrapDIV.find('.swiper-container.dateSwiper .swiper-slide.on > a').trigger('click.expo'); //on 인것 컨텐츠 활성화 

    	//추천항공사
    	new SwiperTemplate().initFreeSwiper(wrapDIV.find('.swiper-container.rcmAirSwiper'), {loop: false, slidesPerView: 2.3, slidesOffsetBefore: 15, slidesOffsetAfter: 15, spaceBetween: 10});
    }

